// src/components/SidebarFilters.js
import React from 'react';

const SidebarFilters = () => {
  return (
    <div style={{
      width: '280px',
      padding: '1rem',
      backgroundColor: '#f7f9fc',
      borderRight: '1px solid #e0e0e0'
    }}>
      <h3>Quick Filters</h3>

      <label>City</label>
      <select><option>Vancouver</option></select>

      <label>Property Type</label>
      <select><option>All</option></select>

      <label>Bedrooms</label>
      <select><option>Any</option></select>

      <label>Price Range</label>
      <input type="range" min={500000} max={1000000} defaultValue={750000} />

      <label>
        <input type="checkbox" defaultChecked /> Show distressed
      </label>

      <h4>Saved Searches</h4>
      <ul>
        <li>South Main Condos</li>
        <li>Top Hot Leads</li>
      </ul>
    </div>
  );
};

export default SidebarFilters;
